export const getJourneys = async () => {
  try {
    const response = await fetch({
      mode: "cors",
      credentials: "include",
      method: "POST",
      headers: headers,
    });
    return await response.json();
  } catch (e) {
    console.log("Error on JourneyService:", e);
    return [];
  }
};
